script: |
  super -f text -I q13337.spq | sort > q13337.out

inputs:
  - name: q13337.spq
    data: |
      SELECT DISTINCT + + col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( + col2 ) * - col2 NOT BETWEEN + 92 - - 14 + + 96 * col0 * 31 AND NULL;
  - name: tab0

outputs:
  - name: q13337.out
    data: |
      10
      47
      99
